import React from 'react';
import Layout from '../../components/layout';


const Dashboard = ()=>{
    return (
        <Layout childrenStyle={{width:'100%', height:'100%', background:'#F37047', borderRadius:'5px', padding:'15px'}}>
            <h1>teste</h1>
        </Layout>
    )
};

export default Dashboard;
